import Button from "../../../UI/Button";
import style from "./SettingAppearance.module.css";

function SettingAppearance(props) {
  return (
    <form className={style.form}>
      <div className={style["form__list"]}>
        <label id="theme" className={style.label}>
          display theme
        </label>
        <input type="checkbox" className={style.input}></input>
      </div>
      <Button className={style.btn}>change</Button>
    </form>
  );
}

export default SettingAppearance;
